  return (
    <footer className="bg-black text-white py-8 mt-auto">
      <div className="container mx-auto px-4">
        <div className="flex flex-col md:flex-row justify-between items-center space-y-6 md:space-y-0">
          <div className="text-center md:text-left">
            <h3 className="text-xl mb-4">YUKON CLUB</h3>
            <div className="space-y-2">
              <p>Amsterdam, The Netherlands</p>
              <p>info@yukonclub.com</p>
            </div>
          </div>

          <div className="flex flex-col items-center space-y-4">
            <SocialMediaIcons />
            <div className="flex space-x-4 text-sm">
              <Link to="/privacy-policy" className="hover:text-gray-300">Privacy Policy</Link>
              <Link to="/cookie-policy" className="hover:text-gray-300">Cookie Policy</Link>
            </div>
          </div>
        </div>

        <div className="text-center mt-8 text-sm text-gray-400">
          Â© {new Date().getFullYear()} Yukon Club. All rights reserved.
        </div>
      </div>
    </footer>
  );
};

export default Footer;
